  }, [_vm._ssrNode("<section class=\"hero is-light\"><div class=\"hero-body\"><div class=\"has-text-centered\"><h1 class=\"title\">\n\t        Express Entry to Canada\n\t      </h1><h2 class=\"subtitle\">\n\t      \tCanada now allow skilled immigrants to become permanent residents for a very short period of time almost instantly.\n\t\t\t\t\tImmigrants are now chosen as permanent residents based on their ability to settle in Canada and take part in the economy. There is a new system to manage how people with skilled work experience apply.\n\t      </h2></div></div></section><section class=\"section\"><h2 class=\"title is-2\">Federal Skilled workers Class</h2><p>\n\t\t\tThe Federal Skilled Worker Program is for applicants who possess a high level of education and/or significant work experience that can be easily transferred to the Canadian labour market. The applicants must meet certain criteria in order to qualify for this category. The program uses a point system to assess candidates. This point system is not the same as the Comprehensive Ranking System used to rank candidates in Express Entry. In order to create a candidate profile and be assigned a score using the Comprehensive Ranking System, candidates must first qualify for either the Federal Skilled Worker, Federal Skilled Trades or Canadian Experience Class. The points for the Federal Skilled Worker Program are a minimum requirement in order to be eligible to participate in Express Entry. Prospective Applicants must obtain 67 points in order to qualify for the Federal Skilled Worker Program. Points are assigned in accordance with six factors, per below:<br><br><b>Education (maximum 25 points)</b>- the highest level of education attained and the total number of years of education.<br><br><b>Language Ability (maximum 24+4 points)</b>-  the applicant's ability to speak, listen, write and read in either one or both of Canada’s official languages – French or English. Please note that if the applicant claims points under the language factor, proof of language proficiency must be provided. Proficiency in a second official language is worth an additional 4 points.<br><br><b>Work Experience (maximum 15 points)</b>- number of years of full-time or equivalent paid work experience in a high skilled position.<br><br><b>Age (maximum 12 points)</b>- the current age of the applicant, with the most points being awarded to applicants between 21 and 49 years of age.<br><br><b>Arranged Employment in Canada (maximum 10 points)</b>- Either a permanent job offer in Canada for which the applicant is qualified or the applicant is currently employed in Canada and holds a work permit that is valid for at least 12 months.<br><br><b>Adaptability (maximum 10 points)</b>- the applicant may be awarded points for this factor if they can show that they, their spouse or common-law partner, or their dependents will adapt easily to life in Canada.  Examples include education in Canada, arranged employment in Canada and family members who are Canadian Permanent Residents or Citizens.<br><br></p><h2 class=\"title is-2\">Federal Skilled Trades Program</h2><p>The Federal Skilled Trade is for skilled tradespeople who want to immigrate to Canada. In order to qualify, applicants must have at least 2 years work experience in a skilled trade in the last five years and meet certain minimum language requirements. The program uses a point system to assess candidates. This point system is not the same as the Comprehensive Ranking System used to rank candidates in Express Entry. In order to create a candidate profile and be assigned a score using the Comprehensive Ranking System, candidates must first qualify for either the Federal Skilled Worker, Federal Skilled Trades or Canadian Experience Class. The points for the Federal Skilled Worker Program are a minimum requirement in order to be eligible to participate in Express Entry. Applicants to the Federal Skilled Trade Program must make their application using ​the Express Entry immigration application system.</p><h2 class=\"title is-2\">Canadian Experience Class</h2><p>The Canadian Experience Class permits foreign nationals who have been working in Canada for a period of at least one year to apply for Permanent Residence on the basis of their Canadian work experience. In order to qualify, applicants must have a minimum of one year of full time work experience in Canada in the three years preceding the application, meet certain language requirements, and intent to settle outside Quebec. The program uses a point system to assess candidates. This point system is not the same as the Comprehensive Ranking System used to rank candidates in Express Entry. In order to create a candidate profile and be assigned a score using the Comprehensive Ranking System, candidates must first qualify for either the Federal Skilled Worker, Federal Skilled Trades or Canadian Experience Class. The points for the Federal Skilled Worker Program are a minimum requirement in order to be eligible to participate in Express Entry.\n\t\tPlease be advised that qualifying for the Canadian Experience Class is only the first step in immigrating to Canada. Applicants who qualify for the Canadian Experience Class must create a candidate profile in Express Entry and receive an Invitation to Apply for Permanent Residence before submitting their application</p><h2 class=\"title is-2\">A portion of the provincial nominee program</h2><p>The first step for provincial nominee program is to fill out the Express Entry profile and to be selected to get an invitation to apply or ETA.</p><h4 class=\"title is-4\">The express entry processes are:</h4><ul><li>Determine your eligibility.</li><li>Complete an online express entry profile.</li><li>Improve your profile and ranking.</li><li>Receive an invitation to apply and submit your application for permanent residence.</li></ul><h2 class=\"title is-2\">EXPRESS ENTRY APPLICATIONS</h2><p>The new Express Entry system has added a new layer of complexity onto Canada’s already complicated immigration system. CanBangla Immigration Services has been working with the Express Entry since its starting and there is an expertise in setting up Express Entry profiles and guiding successful applicants to apply for permanent residency.</p><h4 class=\"title is-4\">Areas of our Service:</h4><ul><li>Express Entry Profile Creation</li><li>LMIA/Labor Market Impact Assessments</li><li>Provincial Nomination Applications</li><li>Skilled Worker Applications</li><li>Canadian Experience Class applications</li></ul></section>")])
