bility if the refugee claim is first made at an immigration office inside Canada.</p><p class=\"title is-6\">Referral to the Immigration and Refugee Board</p><p style=\"margin-bottom: 10px; text-align: justify;\">If an immigration official considers the claimant to be eligible, then the file is transferred to an independent administrative tribunal called the Immigration and Refugee Board (IRB). If the IRB determines that the claimant is a genuine refugee, the claimant becomes a protected person and can apply for Canadian permanent residence inside Canada.</p></section>")])
