 by land. They will be turned back to the U.S. <br><br>\n\t\t\tA Canada immigration official initially decides if a refugee claim is eligible. If the claim is made at a border crossing, a quick decision can be expected as to eligibility. It takes considerably longer for a decision with respect to eligibility if the refugee claim is first made at an immigration office inside Canada.\n\t\t</p><h6 class=\"title is-6\">Referral to the Immigration and Refugee Board</h6><p style=\"margin-bottom: 10px; text-align: justify;\">\n\t\t\tIf an immigration official considers the claimant to be eligible, then the file is transferred to an independent administrative tribunal called the Immigration and Refugee Board (IRB). The IRB determines whether the claimant is a genuine refugee and deserving of protection in Canada. The claimant is required to first complete a Personal Information Form (PIF) and submit it to the IRB. About 12 months later the claimant attends a hearing before a member of the IRB. In rare cases, where the evidence is exceptionally clear, a claimant may be accepted without a hearing.\n\t\t</p><h6 class=\"title is-6\">Refugee status decision</h6><p style=\"margin-bottom: 10px; text-align: justify;\">\n\t\t\tIf the IRB determines that the claimant is a genuine refugee, the claimant becomes a protected person and can apply for Canadian permanent residence inside Canada. <br><br>\n\t\t\tIf the IRB refuses the claimant, an application for judicial review can be requested from the Federal Court of Canada. If the claimant does not succeed in Federal Court, then removal from Canada becomes probable.<br><br>\n\t\t\tBefore removal, the claimant can ask for a Pre-Removal Risk Assessment (PRRA). The same grounds for protection are assessed as in a refugee claim, but the decision is made by a Canada immigration official instead of the IRB. In cases that have already been considered by the IRB, only changes in circumstances that have occurred since the IRB decision will be taken into account. In some instances, even claimants who are ineligible to make a refugee claim are entitled to a Pre-Removal Risk Assessment (PRRA).<br><br>\n\t\t\tIndividuals who have a refugee claim rejected, abandoned or withdrawn may eventually a Pre-Removal Risk Assessment or (PRRA). This is in opportunity for people who are facing removal from Canada to seek protection by describing, in writing, the risks they believe they would face if removed.<br><br>\n\t\t\tIf you choose someone to represent you in your Canadian Immigration application, it is very important that you are choosing someone who is authorized, who is recognized by the Canadian Government to work on behalf of you. Only Regulated Canadian Immigration Consultants (RCIC) who are members in good standing with the Immigration consultants of Canada Regulatory Council (ICCRC) and lawyers who are members in good standing with a Canadian provincial or territorial law society are authorized representatives.\n\t\t</p></section>")])
